class SuppressVulsDaysComponent {
    constructor(loaderService, baseService, toast) {
        this.loaderService = loaderService;
        this.baseService = baseService;
        this.toast = toast;
        this.snoozeDays = 0;
    }
    ngOnInit() {
        this.getSnoozeDays();
    }
    getSnoozeDays() {
        const params = {};
        if (this.companyid) {
            params.companyid = this.companyid;
        }
        this.loaderService.display(true, 'Getting snooze days...');
        this.baseService.doRequest('/api/cyberutils/getSnoozedays', 'post', params).subscribe((data) => {
            this.loaderService.display(false);
            if (data[0]) {
                this.snoozeDays = data[1];
            }
            else {
                this.toast.sToast('error', data[1]);
            }
        });
    }
    setSnoozeDays(days) {
        const params = { snoozeDays: days };
        if (this.companyid) {
            params.companyid = this.companyid;
        }
        this.loaderService.display(true, 'Updating...');
        this.baseService.doRequest(`/api/cyberutils/setSnoozedays`, 'POST', params).subscribe((result) => {
            this.loaderService.display(false);
            if (result[0]) {
                this.toast.sToast('success', 'Snooze days updated successfully');
            }
            else {
                this.toast.sToast('error', result[1]);
            }
        });
    }
}
